body {
    font-family: 'Crimson Text', serif;
    display: grid;
    grid-template-areas: "header"
    "container"
    "footer";
    grid-template-rows: min-content auto min-content;
}

h1 {
    font-family: 'Parisienne', cursive;
    font-size: 200%;
}

#header { 
    grid-area: header;
}

#container { 
    grid-area: container;
}

img {  
    max-width: 100%;
    height: auto;
}
#footer { 
    grid-area: footer;
}
